import React, { useDebugValue } from "react";
import {CrecheUserx} from '../../../data';

import CrecheCard from "./CrecheCard";

 const CrecheSlider = () => { 

  const datacamp= CrecheUserx.map((data) => {

    return (
      <CrecheCard key={data.key} nom={data.name} prenom={data.Location} Sexe={data.image} Age={data.Age} image={data.image} />
    )
  }) 

  
      return ( 
      <div className="w-full grid pio:grid-cols-2 ">
             {datacamp}
      </div>
            

          );
        };

 export default CrecheSlider;
